import axios from 'axios';
import styled from 'styled-components';

const StyledDiv = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color
`;

const Input = () => {
    return (<StyledDiv>
      <h1>Enter word: </h1>
  </StyledDiv>);
};

export default Input;
